Help me rewrite this function in C#:
def binary_gcd(a: int, b: int) -> int:
    if a < 0 or b < 0:
        raise ValueError("Both numbers must be non-negative")

    if a == 0:
        return b
    if b == 0:
        return a

    shift = 0
    while ((a | b) & 1) == 0:
        shift += 1
        a >>= 1
        b >>= 1

    while (a & 1) == 0:
        a >>= 1

    while b != 0:
        while (b & 1) == 0:
            b >>= 1
        if a > b:
            a, b = b, a
        b = b - a
    return a << shift

